import Weird from "./Weird";
import {useState} from "react";

const RegS=()=>{
    let year= 1820;
    let myname=" JOSHY";
    const [word,setWord]=useState("");

    

    return (
        <>
          <hr/>
          <h2 className="" style={{ color:"red", backgroundColor:"blue" }}>My Profile</h2>
          <ol>
              <li>NAME:{myname}</li>
              <li>BDATE:{2022-year}</li>
              <li>Hours Worked:10</li>
              <li>Salary:{count(10)}</li>
              <li>disp:{looptry()}</li>
              <Weird name="peter" food="Chicken" drink="Water"></Weird>
              <Weird name="Richard" food="Chocolate"></Weird>
              {console.log("HI!")}
          </ol>
        </>
       
      );
}
export default RegS;
